import './Gallery.css';

const images = [
  "../campus.jpg",
  "../building.jpg",
  "../auditoriam.jpg",
  "../lab1.jpg",
  "../lab2.jpg",
  "../classroom.jpg",
  

];

function Gallery() {
  return (
    <div className="gallery">
      <h1>Campus Gallery</h1>
      <div className="gallery-grid">
        {images.map((src, index) => (
          <img key={index} src={src} alt={`Gallery ${index + 1}`} />
        ))}
      </div>
    </div>
  );
}

export default Gallery;
